import "../Style/HamburgerMenu.css"


var body = jQuery(document.body);
var button = jQuery("svg");
var line = jQuery("line");

function HamburgerMenu() {


    function hamburgerClick() {



        if (jQuery(document.body).hasClass("menu-open")) {
            body.removeClass("menu-open");
            return;
        }
        body.addClass("menu-open");

    }





    return (
        <div>
            <svg id ="HamburgerIcon" class="vbp-header-menu-button__svg" onClick={hamburgerClick}>
                <line x1="0" y1="50%" x2="100%" y2="50%" class="top" shape-rendering="crispEdges" />
                <line x1="0" y1="50%" x2="100%" y2="50%" class="middle" shape-rendering="crispEdges" />
                <line x1="0" y1="50%" x2="100%" y2="50%" class="bottom" shape-rendering="crispEdges" />
            </svg>
            <div id="HamburgerMenu">
                <div className="HamburgerItem">SERVICES</div>
                <div className="HamburgerItem">GALLERY</div>
                <div className="HamburgerItem">CONTACT</div>
            </div>
        </div>
    );
}

export default HamburgerMenu;
